#include <iostream>
#include <fstream>
#define inf 2000000000

using namespace std;

ifstream fin("prim.in");
ofstream fout("prim.out");

int n,a[101][101],s,w[101];
bool v[101];

void prim(int x)
{
    int i,j,k,minn,iminn,jminn;
    v[x]=true;
    for (k=1; k<=n-1; k++)
    {
        minn=inf;
        for (i=1; i<=n; i++)
            if (v[i]==true)
                for (j=1; j<=n; j++)
                    if (v[j]==false && a[i][j]!=0 && a[i][j]<minn)
                    {
                        minn=a[i][j];
                        iminn=j;
                        jminn=i;
                    }
        s+=minn;
        v[iminn]=true;
        w[iminn]=jminn;
    }
    return;
}

int main()
{
    int m,i,j,c;
    fin >> n >> m;
    for (; m>=1; m--)
    {
        fin >> i >> j >> c;
        a[i][j]=a[j][i]=c;
    }
    prim(1);
    fout << s << "\n";
    for (i=1; i<=n; i++)
        fout << w[i] << ' ';
    return 0;
}

