int n,m;

struct muchii{
int i,j,cost;
}v[4951],alese[101];

int kruskal ()
{
    int comcon[101],i,x,y,suma=0,k=0,j;
    for (i=1;i<=n;i++)
    comcon[i]=i;
    for (i=1;i<=m;i++)
        if (comcon[v[i].i]!=comcon[v[i].j])
    {
        x=comcon[v[i].i];
        y=comcon[v[i].j];
        for (j=1;j<=n;j++)
            if (comcon[j]==y)
            comcon[j]=x;
        suma=suma+v[i].cost;
        k++;
        alese[k]=v[i];
        if (k==n-1)
            return suma;
    }
    return -1;

}
int main()
{
  int x,i;
  in>>n>>m;
  for (i=1;i<=m;i++)
      in>>v[i].i>>v[i].j>>v[i].cost;
do{
    x=0;
    for (i=1;i<m;i++)
        if (v[i].cost>v[i+1].cost)
    {
        swap (v[i],v[i+1]);
        x=1;
    }

}while (x==1);
out<<kruskal();
out<<endl;
for (i=1;i<n;i++)
{
    out<<alese[i].i<<' '<<alese[i].j;
    out<<endl;
}
    return 0;
}

